Accounting的其他模塊所共有的。","",1,"2020-11-18 20:48:00","added"),(24161,3210,"chinesetraditional","允許管理組織的服務信息。捐贈管理服務可用，並且更多與服務相關的需求可以實現為子模塊。","",1,"2020-11-18 20:49:00","added"),(24162,3211,"chinesetraditional","允許創建會計科目表和創建主要的輸入帳簿。可以為一個財政年度添加日記帳分錄，如果需要，可以根據位置添加日記帳分錄。可以添加供應商購買和客戶銷售信息以及它們各自的退貨信息。可以將付款添加為現金，支票和信用卡。支票可以很容易地在系統中處理。可以將試用餘額，資產負債表和損益表生成為具有不同搜索選項的報告。","",1,"2020-11-18 20:49:00","added"),(24163,3212,"chinesetraditional","管理員和具有默認用戶角色權限的普通用戶角色。可以為管理員或普通用戶類型創建新用戶。需要時，可以使用自定義權限創建其他用戶角色，並將其分配給用戶。提供完整的語言包，因此可以輕鬆添加語言翻譯。","",1,"2020-11-18 20:49:00","added"),(24164,3209,"french","Permet de gérer les emplacements de l'entreprise, les personnes, les informations de base de l'entreprise et la structure de l'entreprise. Les informations ajoutées sous ce module sont communes aux autres modules de Red Cherries Accounting.","",1,"2020-11-18 20:50:00","added"),(24165,3210,"french","Permet de gérer les informations de services d'une organisation. Un service de gestion des dons est disponible et d'autres exigences liées aux services peuvent être implémentées sous forme de sous-modules.","",1,"2020-11-18 20:51:00","added"),(24166,3211,"french","Permet de créer un plan de structure de compte et de créer des livres d'entrée de premier ordre. Des écritures de journal peuvent être ajoutées pour un exercice et si nécessaire en fonction des emplacements. Les informations d'achat du fournisseur et de vente client et leurs informations de retour respectives peuvent être ajoutées. Les paiements peuvent être ajoutés en espèces, chèques et cartes de crédit. Les chèques peuvent être traités très facilement dans le système. La balance de vérification, le bilan et les comptes de profits et pertes peuvent être générés sous forme de rapports avec différentes options de recherche.","",1,"2020-11-18 20:59:00","added"),(24167,3212,"french","Admin et un rôle d'utilisateur normal disponibles avec les autorisations de rôle d'utilisateur par défaut. De nouveaux utilisateurs peuvent être créés pour le type d'administrateur ou d'utilisateur normal. Si nécessaire, des rôles d'utilisateur supplémentaires peuvent être créés avec des autorisations personnalisées et peuvent être attribués aux utilisateurs. Un pack de langue complet est disponible pour que les traductions linguistiques puissent être ajoutées facilement.","",1,"2020-11-18 20:51:00","added"),(24168,3209,"german","Ermöglicht die Verwaltung von Unternehmensstandorten, Personen, Unternehmensgrundinformationen und Unternehmensstruktur. Die Informationen, die unter diesem Modul hinzugefügt werden, gelten auch für die anderen Module des Red Cherries Accounting.","",1,"2020-11-18 21:02:00","added"),(24169,3210,"german","Ermöglicht die Verwaltung von Serviceinformationen einer Organisation. Der Spendenverwaltungsdienst ist verfügbar, und weitere dienstbezogene Anforderungen können als Untermodule implementiert werden.","",1,"2020-11-18 21:02:00","added"),(24170,3211,"german","Ermöglicht das Erstellen eines Kontenplans und das Erstellen von Hauptbucheinträgen. Journaleinträge können für ein Geschäftsjahr und bei Bedarf standortabhängig hinzugefügt werden. Lieferanteneinkaufs- und Kundenverkaufsinformationen sowie deren jeweilige Rückgabeinformationen können hinzugefügt werden. Zahlungen können als Bargeld, Schecks und Kreditkarten hinzugefügt werden. Schecks können sehr einfach im System abgewickelt werden. Testbilanz, Bilanz und Gewinn- und Verlustrechnung können als Berichte mit verschiedenen Suchoptionen erstellt werden.","",1,"2020-11-18 21:13:00","added"),(24171,3209,"hindi","कंपनी के स्थानों, लोगों, कंपनी की बुनियादी जानकारी और कंपनी की संरचना का प्रबंधन करने की अनुमति देता है। इस मॉड्यूल के तहत जानकारी जोड़ने के लाल चेरी लेखा के अन्य मॉड्यूल के लिए आम है।","",1,"2020-11-18 21:14:00","added"),(24172,3210,"hindi","किसी संगठन की सेवाओं की जानकारी प्रबंधित करने की अनुमति देता है। दान प्रबंधन सेवा उपलब्ध है और अधिक सेवाओं से संबंधित आवश्यकताओं को उप मॉड्यूल के रूप में लागू किया जा सकता है।","",1,"2020-11-18 21:15:00","added"),(24173,3211,"hindi","खाता संरचना का चार्ट बनाने और प्रधान प्रविष्टि पुस्तकें बनाने की अनुमति देता है। जर्नल प्रविष्टियों को वित्तीय वर्ष के लिए जोड़ा जा सकता है और यदि आवश्यक हो तो स्थानों पर आधारित किया जा सकता है। आपूर्तिकर्ता क्रय और ग्राहक बिक्री की जानकारी और उनके संबंधित रिटर्न की जानकारी जोड़ी जा सकती है। भुगतान को नकद, चेक और क्रेडिट कार्ड के रूप में जोड़ा जा सकता है। सिस्टम में चेक को बहुत आसानी से हैंडल किया जा सकता है। परीक्षण संतुलन, बैलेंस शीट और लाभ और हानि खातों को विभिन्न खोज विकल्पों के साथ रिपोर्ट के रूप में उत्पन्न किया जा सकता है।","",1,"2020-11-18 21:15:00","added"),(24174,3212,"hindi","व्यवस्थापक और सामान्य उपयोगकर्ता भूमिका डिफ़ॉल्ट उपयोगकर्ता भूमिका अनुमतियों के साथ उपलब्ध है। नए उपयोगकर्ता प्रकार या सामान्य उपयोगकर्ता के लिए बनाए जा सकते हैं। जब आवश्यक अतिरिक्त उपयोगकर्ता भूमिकाएँ कस्टम अनुमतियों के साथ बनाई जा सकती हैं और उन्हें उपयोगकर्ताओं को सौंपा जा सकता है। पूरा भाषा पैक उपलब्ध है ताकि भाषा अनुवाद आसानी से जोड़े जा सकें।","",1,"2020-11-18 21:15:00","added"),(24175,3209,"hungarian","Lehetővé teszi a vállalati helyek, az emberek, a cég alapinformációinak és a vállalati struktúra kezelését. Az e modul alatt hozzáadott információk közösek a Red Cherries Accounting többi moduljában.","",1,"2020-11-18 21:17:00","added"),(24176,3210,"hungarian","Lehetővé teszi egy szervezet szolgáltatási információinak kezelését. Az adománykezelési szolgáltatás elérhető, és több szolgáltatással kapcsolatos követelmény almodulként valósítható meg.","",1,"2020-11-18 21:17:00","added"),(24177,3211,"hungarian","Lehetővé teszi számlatáblázat létrehozását és elsődleges bejegyzési könyvek létrehozását. Naplóbejegyzések hozzáadhatók egy pénzügyi évre, és ha szükséges, a helyek alapján. Hozzáadhatók a beszállítói vásárlási és vásárlói értékesítési információk, valamint a hozzájuk tartozó visszatérési információk. A kifizetések készpénzként, csekkként és hitelkártyaként adhatók hozzá. Az ellenőrzések nagyon egyszerűen kezelhetők a rendszerben. A próbaegyenleg, a mérleg és az eredménykimutatás különféle keresési lehetőségekkel készíthető jelentésként.","",1,"2020-11-18 21:17:00","added"),(24178,3212,"hungarian","Rendszergazda és egy normál felhasználói szerepkör érhető el alapértelmezett felhasználói szerepkör-engedélyekkel. Új felhasználók hozhatók létre rendszergazdák vagy normál felhasználók számára. Szükség esetén további felhasználói szerepkörök hozhatók létre egyedi engedélyekkel, és hozzárendelhetők a felhasználókhoz. Teljes nyelvcsomag áll rendelkezésre, hogy a nyelvi fordítások egyszerűen hozzáadhatók legyenek.","",1,"2020-11-18 21:18:00","added"),(24179,3209,"italian","Permette di gestire sedi aziendali, persone, informazioni di base dell'azienda e struttura aziendale. Le informazioni aggiunte in questo modulo sono comuni agli altri moduli di Red Cherries Accounting.","",1,"2020-11-18 21:19:00","added"),(24180,3210,"italian","Consente di gestire le informazioni sui servizi di un'organizzazione. È disponibile un servizio di gestione delle donazioni e ulteriori requisiti relativi ai servizi possono essere implementati come sottomoduli.","",1,"2020-11-18 21:20:00","added"),(24181,3211,"italian","Permette di creare un grafico della struttura dei conti e creare libri di entrata principali. È possibile aggiungere voci di diario per un esercizio finanziario e, se necessario, in base alle località. È possibile aggiungere informazioni sugli acquisti del fornitore e sulle vendite dei clienti e le rispettive informazioni sui resi. I pagamenti possono essere aggiunti come contanti, assegni e carte di credito. I controlli possono essere gestiti molto facilmente nel sistema. Bilancio di verifica, bilancio e conto profitti e perdite possono essere generati come report con diverse opzioni di ricerca.","",1,"2020-11-18 21:20:00","added"),(24182,3212,"italian","Amministratore e un normale ruolo utente disponibili con autorizzazioni del ruolo utente predefinito. È possibile creare nuovi utenti per tipo di amministratore o utente normale. Quando richiesto, è possibile creare ruoli utente aggiuntivi con autorizzazioni personalizzate e assegnarli agli utenti. È disponibile il language pack completo in modo che le traduzioni in altre lingue possano essere aggiunte facilmente.","",1,"2020-11-18 21:20:00","added"),(24183,3209,"indonesian","Memungkinkan untuk mengelola lokasi perusahaan, orang, informasi dasar perusahaan dan struktur perusahaan. Informasi yang ditambahkan di bawah modul ini adalah umum untuk modul lain dari Akuntansi Ceri Merah.","",1,"2020-11-18 21:23:00","added"),(24184,3210,"indonesian","Memungkinkan untuk mengelola informasi layanan dari suatu organisasi. Layanan pengelolaan donasi tersedia dan lebih banyak persyaratan terkait layanan dapat diimplementasikan sebagai sub modul.","",1,"2020-11-18 21:23:00","added"),(24185,3211,"indonesian","Memungkinkan untuk membuat bagan struktur akun dan membuat buku entri utama. Entri jurnal dapat ditambahkan untuk satu tahun keuangan dan jika diperlukan berdasarkan lokasi. Informasi pembelian pemasok dan penjualan pelanggan dan informasi pengembalian masing-masing dapat ditambahkan. Pembayaran dapat ditambahkan sebagai uang tunai, cek dan kartu kredit. Pengecekan dapat ditangani dalam sistem dengan sangat mudah. Neraca percobaan, neraca dan akun untung dan rugi dapat dibuat sebagai laporan dengan opsi pencarian yang berbeda.","",1,"2020-11-18 21:24:00","added"),(24186,3210,"japanese","組織のサービス情報を管理できます。寄付管理サービスが利用可能であり、より多くのサービス関連の要件をサブモジュールとして実装できます。","",1,"2020-11-18 21:27:00","added"),(24187,3211,"japanese","勘定体系のチャートを作成し、プライムエントリーブックを作成できます。仕訳は会計年度に追加でき、必要に応じて場所に基づいて追加できます。サプライヤーの購入情報と顧客の販売情報、およびそれぞれの返品情報を追加できます。支払いは、現金、小切手、クレジットカードで追加できます。小切手はシステムで非常に簡単に処理できます。試算表、貸借対照表、損益計算書は、さまざまな検索オプションを使用してレポートとして生成できます。","",1,"2020-11-18 21:27:00","added"),(24188,3212,"japanese","管理者と通常のユーザーロールは、デフォルトのユーザーロール権限で使用できます。管理者または通常のユーザーのタイプに応じて、新しいユーザーを作成できます。必要に応じて、追加のユーザーロールをカスタム権限で作成し、ユーザーに割り当てることができます。言語翻訳を簡単に追加できるように、完全な言語パックが利用可能です。","",1,"2020-11-18 21:27:00","added"),(24189,3210,"korean","조직의 서비스 정보를 관리 할 수 ​​있습니다. 기부 관리 서비스를 사용할 수 있으며 더 많은 서비스 관련 요구 사항을 하위 모듈로 구현할 수 있습니다.","",1,"2020-11-18 21:29:00","added"),(24190,3211,"korean","계정과 목표를 생성하고 주요 엔트리 장부를 생성 할 수 있습니다. 회계 연도 및 필요한 경우 위치에 따라 분개를 추가 할 수 있습니다. 공급자 구매 및 고객 판매 정보와 각각의 반품 정보를 추가 할 수 있습니다. 지불은 현금, 수표 및 신용 카드로 추가 할 수 있습니다. 수표는 시스템에서 매우 쉽게 처리 할 수 ​​있습니다. 시산표, 대차 대조표 및 손익 계정은 다양한 검색 옵션을 사용하여 보고서로 생성 할 수 있습니다.","",1,"2020-11-18 21:29:00","added"),(24191,3212,"korean","기본 사용자 역할 권한으로 사용 가능한 관리자 및 일반 사용자 역할. 관리자 또는 일반 사용자 유형에 대해 새 사용자를 만들 수 있습니다. 필요한 경우 사용자 지정 권한으로 추가 사용자 역할을 만들고 사용자에게 할당 할 수 있습니다. 언어 번역을 쉽게 추가 할 수 있도록 완전한 언어 팩을 사용할 수 있습니다.","",1,"2020-11-18 21:29:00","added"),(24192,3209,"nepali","कम्पनी स्थान, व्यक्ति, कम्पनी आधारभूत जानकारी र कम्पनी संरचना प्रबन्ध गर्न अनुमति दिँदछ। यस मोड्युल अन्तर्गत थपिएको जानकारी रेड चेरी लेखाको अन्य मोड्युलहरूमा सामान्य छ।","",1,"2020-11-18 21:30:00","added"),(24193,3210,"nepali","संगठनको सेवाहरूको जानकारी प्रबन्ध गर्न अनुमति दिँदछ। दान व्यवस्थापन सेवा उपलब्ध छ र अधिक सेवा सम्बन्धित आवश्यकताहरू उप मोड्युलहरूको रूपमा लागू गर्न सकिन्छ।","",1,"2020-11-18 21:30:00","added"),(24194,3211,"nepali","खाता संरचनाको चार्ट सिर्जना गर्न र मुख्य प्रविष्टि पुस्तकहरू सिर्जना गर्न अनुमति दिन्छ। जर्नल प्रविष्टिहरू एक वित्तीय वर्षको लागि थप्न सकिन्छ र स्थानहरूको आधारमा आवश्यक छ भने। आपूर्तिकर्ता खरीद र ग्राहक बिक्री जानकारी र तिनीहरूको सम्बन्धित फिर्ती जानकारी थप्न सकिन्छ। भुक्तानी नगद, चेक र क्रेडिट कार्डको रूपमा थप्न सकिन्छ। चेक प्रणाली मा सजिलैसँग ह्यान्डल गर्न सकिन्छ। परीक्षण सन्तुलन, ब्यालेन्स शीट र नाफा र नोक्सान खाताहरू बिभिन्न खोज विकल्पहरूको साथ रिपोर्टको रूपमा उत्पन्न गर्न सकिन्छ।","",1,"2020-11-18 21:31:00","added"),(24195,3212,"nepali","व्यवस्थापक र पूर्वनिर्धारित प्रयोगकर्ता भूमिका अनुमतिहरूको साथ एक सामान्य प्रयोगकर्ता भूमिका। नयाँ प्रयोगकर्ताहरू व्यवस्थापक वा सामान्य प्रयोगकर्ताको प्रकारको लागि सिर्जना गर्न सकिन्छ। जब आवश्यक छ अतिरिक्त प्रयोगकर्ता भूमिका अनुकूलन अनुमतिहरूको साथ सिर्जना गर्न सकिन्छ र प्रयोगकर्ताहरूलाई तोक्न सकिन्छ। पूर्ण भाषा प्याक उपलब्ध छ कि भाषा अनुवाद सजीलो थप गर्न सकिन्छ।","",1,"2020-11-18 21:31:00","added"),(24196,3209,"portuguese","Permite gerenciar as localizações da empresa, pessoas, informações básicas da empresa e estrutura da empresa. As informações adicionadas neste módulo são comuns aos outros módulos de Contabilidade do Red Cherries.","",1,"2020-11-18 21:33:00","added"),(24197,3210,"portuguese","Permite gerenciar informações de serviços de uma organização. O serviço de gerenciamento de doações está disponível e mais requisitos relacionados a serviços podem ser implementados como submódulos.","",1,"2020-11-18 21:33:00","added"),(24198,3211,"portuguese","Permite criar um plano de estrutura de contas e criar livros de entrada principais. Os lançamentos contábeis manuais podem ser adicionados para um ano financeiro e, se necessário, com base nos locais. Podem ser adicionadas informações de compra de fornecedores e vendas de clientes e suas respectivas informações de devolução. Os pagamentos podem ser adicionados em dinheiro, cheques e cartões de crédito. Os cheques podem ser tratados no sistema com muita facilidade. Balancetes, balanços e contas de lucros e perdas podem ser gerados como relatórios com diferentes opções de pesquisa.","",1,"2020-11-18 21:33:00","added"),(24199,3209,"polish","Umożliwia zarządzanie lokalizacjami firmy, ludźmi, podstawowymi informacjami firmy i strukturą firmy. Informacje dodawane w ramach tego modułu są wspólne dla innych modułów Księgowości Red Cherries.","",1,"2020-11-18 21:35:00","added"),(24200,3210,"polish","Umożliwia zarządzanie informacjami o usługach organizacji. Dostępna jest usługa zarządzania darowiznami, a więcej wymagań związanych z usługami można wdrożyć jako podmoduły.","",1,"2020-11-18 21:35:00","added"),(24201,3209,"russian","Позволяет управлять местоположением компании, людьми, основной информацией компании и структурой компании. Информация, добавляемая в этом модуле, является общей для других модулей Red Cherries Accounting.","",1,"2020-11-18 21:37:00","added"),(24202,3210,"russian","Позволяет управлять информацией об услугах организации. Доступна служба управления пожертвованиями, и дополнительные требования, связанные с услугами, могут быть реализованы в виде подмодулей.","",1,"2020-11-18 21:38:00","added"),(24203,3211,"russian","Позволяет создавать план структуры счетов и создавать основные книги учета. Записи в журнал могут быть добавлены за финансовый год и, если необходимо, в зависимости от местоположения. Можно добавить информацию о закупках и продажах для поставщиков и их соответствующую информацию о возврате. Платежи могут быть добавлены наличными, чеками и кредитными картами. В системе очень легко выполнять чеки. Пробный баланс, баланс и отчеты о прибылях и убытках могут быть созданы в виде отчетов с различными параметрами поиска.","",1,"2020-11-18 21:38:00","added"),(24204,3209,"romanian","Permite gestionarea locațiilor companiei, a persoanelor, a informațiilor de bază despre companie și a structurii companiei. Informațiile adăugate în cadrul acestui modul sunt comune celorlalte module din Contabilitatea Cireșelor Roșii.","",1,"2020-11-18 21:39:00","added"),(24205,3210,"romanian","Permite gestionarea informațiilor despre servicii ale unei organizații. Serviciul de gestionare a donațiilor este disponibil și mai multe cerințe legate de servicii pot fi implementate ca sub module.","",1,"2020-11-18 21:40:00","added"),(24206,3211,"romanian","Permite crearea unei hărți a structurii conturilor și crearea de cărți de intrări principale. Înregistrările din jurnal pot fi adăugate pentru un exercițiu financiar și, dacă este necesar, în funcție de locații. Se pot adăuga informații privind cumpărarea furnizorului și vânzările clienților și informațiile despre returnarea acestora. Plățile pot fi adăugate ca numerar, cecuri și carduri de credit. Verificările pot fi gestionate foarte ușor în sistem. Soldul de probă, bilanțul și conturile de profit și pierdere pot fi generate ca rapoarte cu diferite opțiuni de căutare.","",1,"2020-11-18 21:40:00","added"),(24207,3209,"spanish","Permite administrar la ubicación de la empresa, las personas, la información básica de la empresa y la estructura de la empresa. La información que se agrega en este módulo es común a los otros módulos de Contabilidad de Red Cherries.","",1,"2020-11-18 21:42:00","added"),(24208,3210,"spanish","Permite administrar la información de los servicios de una organización. El servicio de gestión de donaciones está disponible y se pueden implementar más requisitos relacionados con los servicios como submódulos.","",1,"2020-11-18 21:42:00","added"),(24209,3211,"spanish","Permite crear un plan de estructura de cuentas y crear libros de entrada principal. Se pueden agregar entradas de diario para un año financiero y, si es necesario, según las ubicaciones. Se puede agregar información de compras de proveedores y ventas de clientes y su respectiva información de devolución. Los pagos se pueden agregar en efectivo, cheques y tarjetas de crédito. Los cheques se pueden manejar en el sistema muy fácilmente. El balance de comprobación, el balance general y las cuentas de pérdidas y ganancias se pueden generar como informes con diferentes opciones de búsqueda.","",1,"2020-11-18 21:42:00","added"),(24210,3209,"tamil","நிறுவனத்தின் இருப்பிடங்கள், நபர்கள், நிறுவனத்தின் அடிப்படை தகவல்கள் மற்றும் நிறுவனத்தின் கட்டமைப்பை நிர்வகிக்க அனுமதிக்கிறது. இந்த தொகுதியின் கீழ் சேர்ப்பது ரெட் செர்ரிஸ் கணக்கியலின் மற்ற தொகுதிகளுக்கு பொதுவானது.","",1,"2020-11-18 21:43:00","added"),(24211,3210,"tamil","ஒரு நிறுவனத்தின் சேவை தகவல்களை நிர்வகிக்க அனுமதிக்கிறது. நன்கொடை மேலாண்மை சேவை கிடைக்கிறது மற்றும் கூடுதல் சேவைகள் தொடர்பான தேவைகளை துணை தொகுதிகளாக செயல்படுத்த முடியும்.","",1,"2020-11-18 21:44:00","added"),(24212,3211,"tamil","கணக்கு கட்டமைப்பின் விளக்கப்படத்தை உருவாக்க மற்றும் முதன்மை நுழைவு புத்தகங்களை உருவாக்க அனுமதிக்கிறது. ஜர்னல் உள்ளீடுகளை ஒரு நிதியாண்டுக்கு சேர்க்கலாம் மற்றும் தேவைப்பட்டால் இருப்பிடங்களின் அடிப்படையில் சேர்க்கலாம். சப்ளையர் வாங்குதல் மற்றும் வாடிக்கையாளர் விற்பனை தகவல்கள் மற்றும் அந்தந்த வருவாய் தகவல்களை சேர்க்கலாம். கொடுப்பனவுகளை ரொக்கம், காசோலைகள் மற்றும் கிரெடிட் கார்டுகளாக சேர்க்கலாம். காசோலைகளை கணினியில் மிக எளிதாக கையாள முடியும். சோதனை இருப்பு, இருப்புநிலை மற்றும் இலாப நட்ட கணக்குகளை வெவ்வேறு தேடல் விருப்பங்களுடன் அறிக்கைகளாக உருவாக்க முடியும்.","",1,"2020-11-18 21:44:00","added"),(24213,3209,"thai","อนุญาตให้จัดการที่ตั้ง บริษัท บุคคลข้อมูลพื้นฐานของ บริษัท และโครงสร้าง บริษัท การเพิ่มข้อมูลภายใต้โมดูลนี้เป็นเรื่องปกติสำหรับโมดูลอื่น ๆ ของ Red Cherries Accounting","",1,"2020-11-18 21:45:00","added"),(24214,3210,"thai","อนุญาตให้จัดการข้อมูลบริการขององค์กร มีบริการจัดการการบริจาคและข้อกำหนดที่เกี่ยวข้องกับบริการอื่น ๆ สามารถนำไปใช้เป็นโมดูลย่อยได้","",1,"2020-11-18 21:45:00","added"),(24215,3211,"thai","อนุญาตให้สร้างผังโครงสร้างบัญชีและสร้างสมุดบัญชีรายชื่อหลัก สามารถเพิ่มรายการบันทึกประจำวันสำหรับปีบัญชีและหากต้องการตามสถานที่ตั้ง สามารถเพิ่มข้อมูลการจัดซื้อของซัพพลายเออร์และการขายของลูกค้าและข้อมูลการคืนสินค้าตามลำดับได้ การชำระเงินสามารถเพิ่มเป็นเงินสดเช็คและบัตรเครดิต เช็คสามารถจัดการในระบบได้ง่ายมาก สามารถสร้างงบทดลองงบดุลและบัญชีกำไรขาดทุนเป็นรายงานพร้อมตัวเลือกการค้นหาที่แตกต่างกัน","",1,"2020-11-18 21:45:00","added"),(24216,3212,"thai","ผู้ดูแลระบบและบทบาทผู้ใช้ปกติพร้อมใช้งานพร้อมสิทธิ์บทบาทผู้ใช้เริ่มต้น ผู้ใช้ใหม่สามารถสร้างขึ้นสำหรับประเภทผู้ดูแลระบบหรือผู้ใช้ปกติ เมื่อสามารถสร้างบทบาทผู้ใช้เพิ่มเติมที่ต้องการได้ด้วยสิทธิ์ที่กำหนดเองและสามารถกำหนดให้กับผู้ใช้ได้ มีชุดภาษาที่สมบูรณ์เพื่อให้สามารถเพิ่มคำแปลภาษาได้อย่างง่ายดาย","",1,"2020-11-18 21:46:00","added"),(24217,3209,"turkish","Şirket konumlarını, kişileri, şirket temel bilgilerini ve şirket yapısını yönetmeye izin verir. Bu modül altında eklenen bilgiler, Red Cherries Accounting'in diğer modüllerinde ortaktır.","",1,"2020-11-18 21:47:00","added"),(24218,3210,"turkish","Bir kuruluşun hizmet bilgilerini yönetmeye izin verir. Bağış yönetimi hizmeti mevcuttur ve hizmetlerle ilgili daha fazla gereksinim alt modüller olarak uygulanabilir.","",1,"2020-11-18 21:47:00","added"),(24219,3211,"turkish","Hesap yapısı planı oluşturmaya ve ana giriş defterleri oluşturmaya izin verir. Yevmiye kayıtları bir mali yıl için ve gerekirse lokasyonlara göre eklenebilir. Tedarikçi satın alma ve müşteri satış bilgileri ve ilgili iade bilgileri eklenebilir. Ödemeler nakit, çek ve kredi kartı olarak eklenebilir. Sistemde kontroller çok kolay bir şekilde yapılabilmektedir. Deneme bilançosu, bilanço ve kar zarar hesapları farklı arama seçenekleriyle raporlar olarak oluşturulabilir.","",1,"2020-11-18 21:47:00","added"),(24220,3212,"turkish","Varsayılan kullanıcı rolü izinleriyle kullanılabilen yönetici ve normal bir kullanıcı rolü. Yönetici veya normal kullanıcı türü için yeni kullanıcılar oluşturulabilir. Gerektiğinde özel izinlerle ek kullanıcı rolleri oluşturulabilir ve kullanıcılara atanabilir. Dil çevirilerinin kolayca eklenebilmesi için eksiksiz dil paketi mevcuttur.","",1,"2020-11-18 21:47:00","added"),(24221,3209,"ukrainian","Дозволяє керувати місцезнаходженням компанії, людьми, основною інформацією та структурою компанії. Інформація, додана за цим модулем, є загальною для інших модулів бухгалтерії Червоних вишень.","",1,"2020-11-18 21:49:00","added"),(24222,3210,"ukrainian","Дозволяє управляти інформацією про послуги організації. Послуга управління пожертвами доступна, і більше вимог, пов’язаних із послугами, можна реалізувати як підмодулі.","",1,"2020-11-18 21:49:00","added"),(24223,3211,"ukrainian","Дозволяє створювати структуру рахунку та створювати основні книги. Записи журналу можна додавати за фінансовий рік і, якщо потрібно, за місцем розташування. Можна додати інформацію про закупівлю та продаж покупців, а також інформацію про їх повернення. Платежі можна додавати як готівку, чеки та кредитні картки. Перевірки можна легко обробляти в системі. Пробний баланс, баланс та звіти про прибутки та збитки можуть створюватися як звіти з різними параметрами пошуку.","",1,"2020-11-18 21:49:00","added"),(24224,3212,"ukrainian","Адміністратор і звичайна роль користувача доступні з дозволами на роль користувача за замовчуванням. Нових користувачів можна створити для типу адміністратора або звичайного користувача. За потреби можуть бути створені додаткові ролі користувачів із спеціальними дозволами та можуть бути призначені користувачам. Доступний повний мовний пакет, що дозволяє легко додавати мовні переклади.","",1,"2020-11-18 21:49:00","added"),(24225,3210,"vietnamese","Cho phép quản lý thông tin dịch vụ của một tổ chức. Dịch vụ quản lý quyên góp có sẵn và nhiều yêu cầu liên quan đến dịch vụ hơn có thể được thực hiện dưới dạng mô-đun phụ.","",1,"2020-11-18 21:51:00","added"),(24226,3211,"vietnamese","Cho phép tạo biểu đồ cơ cấu tài khoản và tạo sổ nhập nguyên tố. Các mục nhật ký có thể được thêm vào cho một năm tài chính và nếu được yêu cầu dựa trên địa điểm. Thông tin mua hàng của nhà cung cấp và thông tin bán hàng của khách hàng và thông tin trả hàng tương ứng của họ có thể được thêm vào. Các khoản thanh toán có thể được thêm vào dưới dạng tiền mặt, séc và thẻ tín dụng. Séc có thể được xử lý trong hệ thống rất dễ dàng. Số dư thử nghiệm, bảng cân đối kế toán và tài khoản lãi lỗ có thể được tạo dưới dạng báo cáo với các tùy chọn tìm kiếm khác nhau.","",1,"2020-11-18 21:51:00","added"),(24227,3209,"sinhala","සමාගම් ස්ථාන, පුද්ගලයින්, සමාගමේ මූලික තොරතුරු සහ සමාගම් ව්‍යුහය කළමනාකරණය කිරීමට ඉඩ දෙයි. මෙම මොඩියුලය යටතේ තොරතුරු Red Cherries Accounting අනෙක් මොඩියුලයන්ට පොදු වේ.","",1,"2020-11-18 21:56:00","added"),(24228,3210,"sinhala","සංවිධානයක සේවා තොරතුරු කළමනාකරණය කිරීමට ඉඩ දෙයි. පරිත්යාග කළමනාකරණ සේවාව ලබා ගත හැකි අතර තවත් සේවාවන් හා සම්බන්ධ අවශ්යතා උප මොඩියුල ලෙස ක්රියාත්මක කළ හැකිය.","",1,"2020-11-18 21:56:00","added"),(24229,3211,"sinhala","ගිණුම් ව්‍යුහයේ ප්‍රස්ථාරයක් නිර්මාණය කිරීමට සහ ප්‍රයිම් එන්ට්‍රි පොත් නිර්මාණය කිරීමට ඉඩ ලබා දේ. මූල්‍ය වර්ෂයක් සඳහා සහ ස්ථාන මත පදනම්ව අවශ්‍ය නම් ජර්නල් සටහන් එකතු කළ හැකිය. සැපයුම්කරු මිලදී ගැනීම සහ පාරිභෝගික විකුණුම් තොරතුරු සහ ඔවුන්ගේ ආපසු භාරදීම් තොරතුරු එකතු කළ හැකිය. ගෙවීම් මුදල්, චෙක්පත් සහ ක්‍රෙඩිට් කාඩ් ලෙස එකතු කළ හැකිය. චෙක්පත් පද්ධතිය තුළ ඉතා පහසුවෙන් හැසිරවිය හැකිය. අත්හදා බැලීමේ ශේෂය, ශේෂ පත්‍රය සහ ලාභ හා අලාභ ගිණුම් විවිධ සෙවුම් විකල්ප සහිත වාර්තා ලෙස ජනනය කළ හැකිය.","",1,"2020-11-18 21:58:00","added"),(24230,3226,"chinesesimplified","应付金额不能为负值。","",1,"2020-11-23 09:50:00","added"),(24231,3227,"chinesesimplified","余额金额不能为负值。","",1,"2020-11-23 09:50:00","added"),(24232,1250,"chinesesimplified","Allows to manage company locations, people, company basic information and company structure. The information adding under this module is common to the other modules of Red Cherries ERP. Module is completely implemented and available in version 5.0 Beta 1","",1,"2020-11-23 09:59:00","added"),(24233,2515,"chinesesimplified","用户名","",1,"2020-11-23 10:00:00","added"),(24234,2516,"chinesesimplified","密码","",1,"2020-11-23 10:00:00","added"),(24235,3226,"chinesetraditional","應付金額不能為負值。","",1,"2020-11-23 10:02:00","added"),(24236,3227,"chinesetraditional","餘額金額不能為負值。","",1,"2020-11-23 10:02:00","added"),(24237,3226,"french","Le montant à payer ne peut pas être une valeur négative.","",1,"2020-11-23 10:06:00","added"),(24238,3227,"french","Le montant du solde ne peut pas être une valeur négative.","",1,"2020-11-23 10:06:00","added"),(24239,3226,"german","Der zu zahlende Betrag kann kein negativer Wert sein.","",1,"2020-11-23 10:09:00","added"),(24240,3227,"german","Der Saldobetrag kann kein negativer Wert sein.","",1,"2020-11-23 10:09:00","added"),(24241,3226,"hindi","देय राशि ऋणात्मक मान नहीं हो सकती।","",1,"2020-11-23 10:11:00","added"),(24242,3227,"hindi","शेष राशि ऋणात्मक मान नहीं हो सकती।","",1,"2020-11-23 10:11:00","added"),(24243,3226,"hungarian","A fizetendő összeg nem lehet negatív érték.","",1,"2020-11-23 10:14:00","added"),(24244,3227,"hungarian","Az egyenleg nem lehet negatív érték.","",1,"2020-11-23 10:14:00","added"),(24245,3226,"italian","L'importo da pagare non può essere un valore negativo.","",1,"2020-11-23 10:16:00","added"),(24246,3227,"italian","L'importo del saldo non può essere un valore negativo.","",1,"2020-11-23 10:16:00","added"),(24247,3226,"indonesian","Jumlah Hutang tidak boleh nilai negatif.","",1,"2020-11-23 10:18:00","added"),(24248,3227,"indonesian","Jumlah Saldo tidak boleh berupa nilai negatif.","",1,"2020-11-23 10:18:00","added"),(24249,3183,"indonesian","Cr","",1,"2020-11-23 10:18:00","added"),(24250,3226,"japanese","支払額を負の値にすることはできません。","",1,"2020-11-23 10:20:00","added"),(24251,3227,"japanese","残高は負の値にすることはできません。","",1,"2020-11-23 10:20:00","added"),(24252,3226,"korean","지불 금액은 음수 일 수 없습니다.","",1,"2020-11-23 10:26:00","added"),(24253,3227,"korean","잔액은 음수 일 수 없습니다.","",1,"2020-11-23 10:26:00","added"),(24254,3226,"nepali","रकम भुक्तानी नकारात्मक मान हुन सक्दैन।","",1,"2020-11-23 10:28:00","added"),(24255,3227,"nepali","शेष रकम एक नकारात्मक मान हुन सक्दैन।","",1,"2020-11-23 10:29:00","added"),(24256,3226,"portuguese","O valor a pagar não pode ser um valor negativo.","",1,"2020-11-23 10:31:00","added"),(24257,3227,"portuguese","O valor do saldo não pode ser um valor negativo.","",1,"2020-11-23 10:31:00","added"),(24258,3272,"portuguese","Third Party Cheque","",1,"2020-11-23 10:31:00","added"),(24259,3226,"polish","Kwota do zapłaty nie może mieć wartości ujemnej.","",1,"2020-11-23 10:34:00","added"),(24260,3227,"polish","Kwota salda nie może być wartością ujemną.","",1,"2020-11-23 10:34:00","added"),(24261,3226,"russian","Сумма к оплате не может быть отрицательной.","",1,"2020-11-23 10:37:00","added"),(24262,3227,"russian","Сумма баланса не может быть отрицательной величиной.","",1,"2020-11-23 10:37:00","added"),(24263,3226,"romanian","Suma de plătit nu poate fi o valoare negativă.","",1,"2020-11-23 10:40:00","added"),(24264,3227,"romanian","Valoarea soldului nu poate fi o valoare negativă.","",1,"2020-11-23 10:40:00","added"),(24265,3226,"sinhala","ගෙවි